import React from 'react';
import { Card, Avatar, Button } from 'antd';

const dummy = {
    nickname : 'JINNE',
    Post : [],
    Followings : [],
    Followers : [],
    isLoggedIn : true,
}

const UserProfile = () => {
    return (
        <Card style={{margin : '40px 20px 20px'}} actions = {[
            <div key="twit">짹짹<br/>{dummy.Post.length}</div>,
            <div key="following">팔로윙<br/>{dummy.Followers.length}</div>,
            <div key="follower">팔로워<br/>{dummy.Followings.length}</div>
        ]}>
        <Card.Meta
            avatar = {<Avatar>{dummy.nickname[0]}</Avatar>}
            title = {dummy.nickname}
        />
        </Card>
    )
}

export default UserProfile;
